    function setUniswapFactory(address _uniswapFactory) external onlyOwner {
        require(_uniswapFactory != address(0), "Zero address");
        uniswapFactory = _uniswapFactory;
    }

    function setAstraContract(address _astraContract) external onlyOwner {
        require(_astraContract != address(0), "Zero address");
        astraContract = _astraContract;
